import React from 'react';

function BoardList({ posts, onDelete }) {
  return (
    <ul>
      {posts.map(post => (
        <li key={post.id}>
          {post.title}
          <button onClick={() => onDelete(post.id)}>삭제</button>
        </li>
      ))}
    </ul>
  );
}

export default BoardList;
